// src/Profile.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Profile = () => {
    const navigate = useNavigate();

    return (
        <div style={{ padding: '20px', textAlign: 'center' }}>
            <h1>Software Developer</h1>
            <p>Your guide to becoming an impactful Software Developer</p>

            <section>
                <h2>Overview</h2>
                <p>Software Developers design, code, and manage software applications that bring ideas to life...</p>
            </section>

            <section>
                <h2>Essential Skills</h2>
                <ul>
                    <li>Proficiency in programming languages like Python, Java, and JavaScript</li>
                    <li>Knowledge of web development technologies (HTML, CSS, React)</li>
                    <li>Experience with version control (Git)</li>
                </ul>
            </section>

            <button 
                style={{ padding: '10px 20px', fontSize: '16px', cursor: 'pointer' }}
                onClick={() => navigate('/contact')}
            >
                Contact Me
            </button>
        </div>
    );
};

export default Profile;
